Tara, the illegitimate daughter of the noble Queen Adelaide, was thrown away as a baby and raised by poor relatives. They sent her to a notorious mage in the west named Judas, whom she had never met before.

While she is overwhelmed by her so-called guardian's impossible beauty, he and the others in the castle treat her warily, hateful of the queen.

However, the girl's lovable innocence and pitiful nature begin to melt the immortal magician's frozen heart...

&ldquo;Stop acting cute. You&rsquo;re like a vixen.&rdquo;

&ldquo;Why do you keep calling me a vixen?&rdquo;

&quot;I don't care if that child is broken. To me, life and destruction are one and the same.&quot;

A healing romance blooms between an obsessive and frigid 'guardian' that only shows kindness to one girl, and a little 'miss' scarred by her past.

